// Use custom command to navigate to Bank Accounts
cy.visit(`${baseUrl}/login`);
cy.login('Heath93', 's3cret');
//cy.contains('Bank Accounts').click();
cy.contains('Bank Accounts', {
  timeout: 10000
}).should('be.visible').click();
//cy.contains('button', 'CREATE').click();
cy.get('a[data-test="bankaccount-new"]', {
  timeout: 10000
}).should('be.visible').click();
cy.wait(1000);
cy.get('#bankaccount-bankName-input', {
  timeout: 10000
}).should('be.visible').type('ABCDE'); // Adjust the selector if necessary
cy.get('input[name="routingNumber"]').type('123456789');
cy.get('input[name="accountNumber"]').type('987654321');
//cy.contains('button', 'SAVE').click();
cy.get('button[data-test="bankaccount-submit"]').should('be.visible').click();
// Use custom command to create a new bank account
//cy.createBankAccount('ABCDE', '123456789', '987654321');
// Assert that the new bank account appears in the bank account list
cy.contains('ABCDE').should('exist');
cy.wait(1000);
// cy.get('button.MuiButton-containedPrimary'), { timeout: 10000 }).should('be.visible').click();
cy.get('div[data-test="sidenav-signout"]').should('be.visible').click();
//cy.get('a[data-test="logout"]'
// Verify that the user is redirected to the login page
cy.url().should('include', '/signin');
// Alternatively, check if the login form is visible
cy.get('form').should('be.visible');
